import React from 'react';

const DSA = () => {
  return (
    <div className="container mt-4">
      <h2>Data Structures and Algorithms</h2>
      <div className="card">
        <div className="card-body">
          <h5 className="card-title">DSA Topics</h5>
          <ul className="list-group list-group-flush">
            <li className="list-group-item">Arrays and Strings</li>
            <li className="list-group-item">Linked Lists</li>
            <li className="list-group-item">Trees and Graphs</li>
            <li className="list-group-item">Sorting Algorithms</li>
            <li className="list-group-item">Dynamic Programming</li>
            <li className="list-group-item">Search Algorithms</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default DSA;
